import './ExpenseItem.css';

function ExpenseItem() {
    const expanseDate = new Date(2021, 9, 4);
    const expanseTitle = 'Car';
    const expanseCount = '294.7'

    return (
        <div className='expense-item'>
            <div>{expanseDate.toTimeString}</div>
            <div className='expense-item__description'>
                <h2>{expanseTitle}</h2>
                <p  className='expense-item__price'>${expanseCount}</p>
            </div>
        </div>

    )
}

export default ExpenseItem;
